import React from 'react'

function NavBar() {
  return (
    <div className='navbar h-[60px] shadow-md relative z-10'>
        <div className='wrapper pl-[20px] pr-[20px] pt-[10px] pb-[10px] flex justify-between items-center'>
            <div>1</div>
            <div>2</div>
            <div>3</div>
        </div>

    </div>
  )
}

export default NavBar
